import React from 'react'; 
import { Box, Botao } from "../../Components/UI";
import { extratoLista } from '../../info';

const Extrato = () => {
  return (
    <Box>
      {extratoLista.updates.map(({id, type, value, date, from}) => {
      return (
        <div key={id}>
          <div>{type}</div>
          <div>{from}</div>
        </div>
      );
      })}
      <Botao>Ver Mais </Botao>
    </Box>
  ); 
};

export default Extrato;
